import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Age</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
            <td>John</td>
            <td>20</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default App;
